import { Button } from "antd";
import './home.styl'
import { useNavigate } from "react-router-dom";

function Home() {

    // 创建路由钩子
    const navigate111 = useNavigate()
    return (
        <div className="P-home">
            <h1>Home Page</h1>
            <div className="ipt-con">
            <Button onClick={()=>{navigate111('/login')}}>返回登录</Button>
            </div>
        </div>
    )
}

export default Home
